function tranferObjectToArray(object) {
  const keys = Object.keys(object);
  return Array(keys.length).fill(0).map((i, r) => object[keys[r]]);
}

function exportCodes(ships) {
  return ships.map(ship => JSON.parse(ship).typespec.code);
}

